- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1CFor the 9/28/11 $100.00 contra disbursement
    reported on Line 21b of this report and transferred to Line 23, the full purpose
    of disbursement should be noted as: In-Kind Consulting Services, see Line 23 item.
    For the 9/30/11 $100.00 contra disbursement reported on Line 21b of this report
    and transferred to Line 23, the full purpose of disbursement should be noted as:
    In-Kind Consulting Services, see Line 23 These amounts relate to an original $8,000.00
    advance payment made to the National Association of Realtors for consulting services
    on 9/13/2010 and reported on Line 21b of the October 2010 monthly report. Subsequently
    in 2010, we utilized $6,200.00 of this advanced payment as consulting services
    attributable to independent expenditures & reflected as negative amounts subtracted
    from Line 21b and transferred to Line 24.  In April 2011, we utilized $100.00
    of this advance payment as consulting services attributable to In-Kind events
    & reflected as negative amounts subtracted from Line 21b and transferred to Line
    23.  In May 2011, we utilized $100.00 of this advance payment as consulting services
    attributable to In-Kind events & reflected as negative amounts subtracted from
    Line 21b and transferred to Line 23.  In June 2011, we utilized $100.00 of this
    advance payment as consulting services attributable to In-Kind events & reflected
    as negative amounts subtracted from Line 21b and transferred to Line 23.  In September
    2011, $100.00 of the original $8,000.00 is being utilized as consulting services
    attributable to In-Kind events & reflected on Line 23 of this period, with the
    full purpose of disbursement as: Transfer from Line 21b to Line 23 attributed
    as consulting services on 9/28/2011 for In-Kind event for Carolyn McCarthy.  Also
    in September 2011, $100.00 of the original $8,000.00 is being utilized as consulting
    services attributable to In-Kind events & reflected on Line 23 in this period,
    with the full purpose of disbursement as: Transfer from Line 21b to Line 23 attributed
    as consulting services on 9/30/11 for In-Kind event for Kenny Marchant.  For Line
    22 of this report, the following entry is a refund for a contribution received
    by this committee that was unacceptable. The entry we reference contains the payee,
    date & amount of disbursement, along with the original date of receipt. The following
    contribution represented by the refund is reported as unitemized on the 10/20/11
    monthly report: Louisiana RPAC $63.00 on 9/26/11 orig recd 9/02/11. For Line 23
    of this report, the following disbursements for consulting services will bring
    the candidate over the allowable limit allowed for the 2012 Primary election period
    due to a refund that was not received in September as anticipated: Line 23, Page
    177 $100.00 payable to National Association of Realtors for consulting services
    for Brad Sherman & Line 23, Page 205 $100.00 payable to Votesane  for In-Kind
    services to facilitate online fundraising to committee for Brad Sherman.  We have
    received the refund in October which will be applied towards the 2012 Primary
    Election period for Brad Sherman and therefore, he will be within the allowable
    limits.\n"
